void BriefDesc::descriptorFromBriefScoreDiv(const std::vector<uint32_t>& score, uint32_t scoreMax)
{
  assert(score.size()==BRIEF_K*8);
  uint32_t scoreHalf=scoreMax/2;
  for(uint32_t i=0; i<score.size(); ++i)
  {
//    assert(i/8<BRIEF_K);
//    assert(i/8>=0);
//    assert(i%8<8);
//    assert(i%8>=0);
    uint32_t bitPos=i%8;
    uint32_t bytePos=i/8;
    if(bitPos==0) bd[bytePos]=0;
    if(score[i]>scoreHalf) bd[bytePos] |= (1<<(bitPos));

//    if(score[i]>scoreHalf)
//    {
//      bd[i/8] |= (1<<(i%8));
//    }else{
//      bd[i/8] &= ~(1<<(i%8));
//    }
  }
}

void BriefDesc::descriptorFromBriefScore(const std::vector<uint32_t>& score, uint32_t scoreMax)
{
  assert(score.size()==N_BITS);
  uint32_t scoreHalf=scoreMax/2;
  for (size_t i=0; i<BRIEF_K; ++i)
  {
    bd[i]=0;
    for(int j=0; j<8;++j)
      if(score[i*8+j] > scoreHalf) bd[i] |= (1<<(j));
  }
}

std::ostream& operator<< (std::ostream &out, const BriefDesc& a){
  out<<"[";
  for (size_t i=0; i<BriefDesc::BRIEF_K; ++i)
  {
    for(int j=0; j<8;++j)
      out<<((a.bd[i]>>j) & 1);
    out<<".";
  }
  out<<"]";
  return out;
};

// load BRIEF descriptors of keypoints seen in keyFrames
bool loadKeyFrameNrs(const std::string pathToData,
    std::vector<size_t>& keyFrameNrs)
{
  char buf[60+pathToData.size()];
  {// read key Frame numbers from file
    sprintf(buf,"%s/keyFrameIDs.txt",pathToData.c_str());
    std::ifstream in(buf);
    size_t frameNr;
    cerr<<"KeyFrame ids: ";
    while(in>>frameNr)
    {
      keyFrameNrs.push_back(frameNr);
      cerr<<frameNr<<"\t";
    }
    cerr<<endl;
  }
  if(keyFrameNrs.size()<1)
    return false; // there should always be at least 2 keyframes.
  else
    return true;
};
